class Purchase extends Component
{
    render()
    {
        return(
            <div className="Purchase">

                <Title>Let's help others today!</Title>

                <Sub>Recently visited</Sub>

                <Restaurant text="McDonalds"></Restaurant>

            </div>
        )
    }
}

export default Purchase;
